import React from "react";
import { Routes, Route } from "react-router-dom";
import PageHome from "./PageHome.jsx";
import Home from "./pages/Home";
import Menubar from "./pages/Menubar";
import Write from "./WritePost";
import Post from "./ShowPost";
import "./styles.css";

const API_URL = "";
function App() {
  return (
    <Routes>
      {/* <Route path="/" element={<Menubar />}></Route> */}
      <Route path="/home" element={<Home />}></Route>
      <Route path="/pagehome/*" element={<PageHome apiUrl={API_URL} />}></Route>
      <Route path="/write" element={<Write />}></Route>
      <Route path="/post" element={<PageHome />}></Route>
      <Route path="*" element={<div>There's nothing here!</div>} />
    </Routes>
  );
}

export default App;
